//     { title: "Sweet iPassport", text: "means an electronic, cryptographically signed, official Economy document, which exists on the iCitizen’s Personal Device and iCitizen’s agent’s smart device(s).An iPassport contains particular information about its iCitizen holder, which includes Claim Proofs and encrypted data about the iCitizen including, name, photograph, addresses, biological birthdate, verified e-mail addresses, credentials, etc. all of which are validated by an Economy Administrator. Unlike national government passports the information contained within the iCitizen’s iPassport is encrypted and under exclusive control of the iPassport (iCitizen) holder. An iPassport may also be used to generate a unique identifier that can be used to identify the iCitizen iPassport holder to another iCitizen and/or LPEntity. Each of the identifiers issued to a counterparty is unique, there is no single identifier or ID for the iCitizen. Claim Proofs are verified and are digitally signed by an Economy Administrator who provides a cryptographically signed verification of the information. These Claim Proof Verifications can be used by the iCitizen iPassportholder to prove information about themselves without revealing the information, such as the age of the iCitizen. Legitimate possession of an officially issued iPassportpermits the iCitizen holder a possibility of receiving a perpetual right to own virtual property in the Economy, such as Squares. The iPassportmay also be used to assist the iCitizen holder in proving their identity and the validity of any claims they make with other Participants in the Economy." },
