//     { title: "parent(s)", text: "means an iCitizen who is a natural (biological) mother or father of a child; offspring or an iCitizen. An iCitizen who adopts a child, or who formally acts as guardian; a protector of a child, for example, a grandparent or another family member. Parents is the plural of parent. Related to Sweet Will inheritance, when there are multiple sets of parents, the parent(s) who had custody of a child most recently are considered the parent(s). Particularly for the purpose of Sweet Will inheritance, a guardian or protector of a child who is a foster parent or state/ government agency shall not be considered a parent(s)." },
//     { title: "Seed", text: "means a reward point, which, until redeemed, is the holder’s digital record of a right to a discount when buying goods or services from a participant in the Economy. Each reward point is equal to a discount worth of one unit of a designated form of cash, to be used in a future purchase. For simplicity, a participant's Seed is recorded using the same number of reward points as the discount value - which are units of the designated form of cash a participant has indicated they wish to use when buying goods and services in the Economy. Participants may convert the number of reward points to another unit of cash (for example, USD to GBP), to be redeemed with a future purchase, whenever they wish. For example, if a participant conducts most of their buying in USD they would indicate they want each Seed to be equivalent to the discounts worth in USD. Therefore, 10 of their Seed, redeemed for a USD purchase discount, would result in a $10 discount when redeemed with a purchase worth more than $10. The Sweet Commerce™ Rewards Program system automatically converts the Seed redeemed by the Buyer, to cash, for the Seller, when the Buyer completes a purchase by making payment. You may give Seed to anyone who is a participant within the Economy but the receipt receives Seed, not cash. Participants may not sell their Seed, Seed is simply a right to a discount provided as a reward for buying within the Economy, designed to encourage more buying." },
//     { title: "Buyer", text: "means an individual or legal person who makes a purchase." },
//     { title: "Seller", text: "means an individual or legal person who sells; a vendor." },
//     { title: "buy", text: "means to purchase something. A transaction to obtain something, like a product or service, in exchange for payment." },
//     { title: "purchased", text: "means to buy; the transfer of property from one participant to another participant of the Economy by an agreement. For example, the payment of cash, or cash with Seed for goods or services purchased within the Economy." },
//     { title: "individual's", text: "means a human being." },
//     { title: "The Sweetbridge Synchronized Commerce Platform", text: "means the Sweetbridge projects open-source platform and the third-party fee-based components which synchronize data and state between LPEntities, including businesses engaging commerce in an Ecosystem and iCitizens of the Economy. The Sweetbridge Synchronized Commerce Platform is designed to automate identity verification, contracting, orders, fulfilment, claim proofs, accounting, audit, attestations, payment and settlement, and to reduce data errors by performing audits in real-time, within a highly secure distributed environment and which maintains data under the strict control of its data owner/data subject. The Sweetbridge Synchronized Commerce Platform is also designed to reduce the ability to lie, cheat, steal, and/or commit fraud in commerce by individuals acting for themselves or for, or on behalf of an Ecosystem LPEntity (a business engaging commerce)." },
//     { title: "Sweetbridge Synchronized Commerce Platform", text: "means the Sweetbridge projects open-source platform and the third-party fee-based components which synchronize data and state between LPEntities, including businesses engaging commerce in an Ecosystem and iCitizens of the Economy. The Sweetbridge Synchronized Commerce Platform is designed to automate identity verification, contracting, orders, fulfilment, claim proofs, accounting, audit, attestations, payment and settlement, and to reduce data errors by performing audits in real-time, within a highly secure distributed environment and which maintains data under the strict control of its data owner/data subject. The Sweetbridge Synchronized Commerce Platform is also designed to reduce the ability to lie, cheat, steal, and/or commit fraud in commerce by individuals acting for themselves or for, or on behalf of an Ecosystem LPEntity (a business engaging commerce)." },
//     { title: "Economy's", text: "means the local, national and international alliance of participants; iCitizens, LPEntities, and Ecosystems, based on the open source Sweetbridge Synchronized Commerce Platform that connects participants and Ecosystems together to provide services, opportunities, resources and value for participants of the Economy. The Sweetbridge Synchronized Commerce Platform automates and simplifies commerce transactions - business activities - using automated contracts, automated accounting, automated risk management, automated settlement and payment that includes data security and access controls that protect identity, information, claims and proofs, all of which is designed to reduce error and fraud in commerce. " },
