//     {title:"Economy Administrator",text:"means an #|LPEntity|#, or an #|iCitizen|#, respectively #|Licensed|# by the Economy Legislator to act as an executive branch department or Agent of the #|Economy|#, in the capacity of a Licenced #|Economy Administrator|#, with authority to issue various forms of permissions to successful applicants. An #|Economy Administrator|# may issue official #|Economy|# documents and #|claim proofs|# granting applicants a certain privilege, including but not limited to, #|Sweet Certificate of eBirths|#, #|iPassports|# and Licenses, all of which grant permission for successful applicants to engage in otherwise prohibited conduct. As part of the application process to be a #|Licensed|# #|Economy Administrator|#, each applicant shall be required to post a performance bond, this will be in the form of a prescribed amount of SWC. Some or all of the posted SWC could be claimed by other #|Economy Administrators|# or Auditors who provide evidence to the #|Economy|# Court and which such evidence is found to show that an #|Economy Administrator|# has failed to properly discharge their respective obligations under their License. In due course, there are likely to be more than one #|Economy Administrator|# operating within the #|Economy|#, this enables a distributed set of #|Economy Administrators|# that actually compete with each other. In practice, these competing #|Economy Administrators|# will serve as peers and may review each other's work, the intention of which is to render corruption more difficult to successfully engage and commit."},
