//     {title: "iPassports",text:"means an electronic, cryptographically signed, official #|Economy|# document, which exists on the #|iCitizen|#’s #|Personal Device|# and #|iCitizen|#’s agent’s smart device(s). An #|iPassport|#contains particular information about its #|iCitizen|# holder, which includes #|Claim Proofs|# and encrypted data about the #|iCitizen|# including, name, photograph, addresses, biological birthdate, verified e-mail addresses, credentials, etc. all of which are validated by an #|Economy Administrator|#. Unlike national #|government|# passports the information contained within the #|iCitizen|#’s #|iPassport|# is encrypted and under exclusive control of the #|iPassport|# (#|iCitizen|#) holder. An #|iPassport|# may also be used to generate a unique identifier that can be used to identify the #|iCitizen|# #|iPassport|# holder to another #|iCitizen|# and/or #|LPEntity|#. Each of the identifiers issued to a counterparty is unique, there is no single identifier or ID for the #|iCitizen|#. #|Claim Proofs|# are verified and are digitally signed by an #|Economy Administrator|# who provides a cryptographically signed verification of the information. These #|Claim Proof Verifications|# can be used by the #|iCitizen|# #|iPassport|# holder to prove information about themselves without revealing the information, such as the age of the #|iCitizen|#. Legitimate possession of an officially issued #|iPassport|# permits the #|iCitizen|# holder a possibility of receiving a perpetual right to #|own|# virtual property in the #|Economy|#, such as #|Squares|#. The #|iPassport|# may also be used to assist the #|iCitizen|# holder in proving their identity and the validity of any claims they make with other Participants in the #|Economy|#."},    
//     {title: "Economy Administrators",text:"means an #|LPEntity|#, or an #|iCitizen|#, respectively #|Licensed|# by the Economy Legislator to act as an executive branch department or Agent of the #|Economy|#, in the capacity of a Licenced #|Economy Administrator|#, with authority to issue various forms of permissions to successful applicants. An #|Economy Administrator|# may issue official #|Economy|# documents and #|claim proofs|# granting applicants a certain privilege, including but not limited to, #|Sweet Certificate of eBirths|#, #|iPassports|# and Licenses, all of which grant permission for successful applicants to engage in otherwise prohibited conduct. As part of the application process to be a #|Licensed|# #|Economy Administrator|#, each applicant shall be required to post a performance bond, this will be in the form of a prescribed amount of SWC. Some or all of the posted SWC could be claimed by other #|Economy Administrators|# or Auditors who provide evidence to the #|Economy|# Court and which such evidence is found to show that an #|Economy Administrator|# has failed to properly discharge their respective obligations under their License. In due course, there are likely to be more than one #|Economy Administrator|# operating within the #|Economy|#, this enables a distributed set of #|Economy Administrators|# that actually compete with each other. In practice, these competing #|Economy Administrators|# will serve as peers and may review each other's work, the intention of which is to render corruption more difficult to successfully engage and commit."},   
