//     {title: "parent",text :"means an #|iCitizen|# who is a #|natural|# (biological) mother or father of a #|child|#; #|offspring|# or an #|iCitizen|#. An #|iCitizen|# who #|adopts|# a #|child|#, or who formally acts as guardian; a protector of a #|child|#, for example, a grandparent or another family member. #|Parents|# is the plural of #|parent|#. Related to #|Sweet Will|# inheritance, when there are multiple sets of #|parents|#, the #|parent(s)|# who had custody of a #|child|# most recently are considered the #|parent(s)|#. Particularly for the purpose of #|Sweet Will|# inheritance, a guardian or protector of a #|child|# who is a foster #|parent(s)|# or state/ #|government agency|# shall not be considered a #|parent(s)|#."},    
